script: |
  super -f text -I q595.spq | sort > q595.out

inputs:
  - name: q595.spq
    data: |
      SELECT - col2 * 84 AS col2 FROM tab2 (FORMAT parquet) cor0 WHERE + col1 + + - col1 * - - ( + ( col0 ) ) * + - col2 BETWEEN + 77 / + col0 AND - col2;
  - name: tab2

outputs:
  - name: q595.out
    data: |
